//placeholder hack
;(function($) {
jQuery.fn.placeholder = function(){
		var i = document.createElement('input'),
			placeholdersupport = 'placeholder' in i;
		if(!placeholdersupport){
			var inputs = jQuery(this);
			inputs.each(function(){
				var input = jQuery(this),
					text = input.attr('placeholder'),
					pdl = 0,
					height = input.outerHeight(),
					width = input.outerWidth(),
					placeholder = jQuery('<div class="phTips">'+text+'</div>');
				try{
					pdl = input.css('padding-left').match(/\d*/i)[0] * 1;
				}catch(e){
					pdl = 5;
				}
				
				var pos = input.offset(), h = input.outerHeight(true), paddingleft = input.css('padding-left');
				
				//input.wrap($('<div></div>').css({position:'relative', zoom:'1', border:'none', background:'none', padding:'none', margin:'none'}));
				placeholder.css({position:'absolute', left:pos.left, top:pos.top, height:h, lienHeight:h, paddingLeft:paddingleft, 'color': "#cecfc9", 'font-size' : "14px"}).appendTo(input.parent());
				placeholder.click(function(){
					//placeholder.css({display:'none'});
					input.focus();
				});
				if(input.val() != ""){
					placeholder.css({display:'none'});
				}else{
					placeholder.css({display:'inline'});
				}
				placeholder.insertAfter(input);
				input.keyup(function(e){
					if(jQuery(this).val() != ""){
						placeholder.css({display:'none'});
					}else{
						placeholder.css({display:'inline'});
					}
				});
			});
		}
		return this;
	};
})(jQuery);
// 把对象调整到中心位置
;(function($) {
	
	$.fn.setmiddle = function() {
		var dl = $(document).scrollLeft(), dt = $(document).scrollTop(), ww = $(
				window).width(), wh = $(window).height(), ow = $(this).width(), oh = $(
				this).height(), left = (ww - ow) / 2 + dl, top = (oh < 4 * wh / 7 ? wh
				* 0.382 - oh / 2 : (wh - oh) / 2) + dt;
		$(this).css({ left : Math.max(left, dl) + 'px', top : Math.max(top, dt) + 'px'});
		return this;
	};
})(jQuery);

;(function($) {
	// 提示信息
	$.tip = function(options) {
		var settings = {
			content : '',
			icon : 'success',
			time : 1500,
			close : false,
			zindex : 2999
		};
		if (options) {
			$.extend(settings, options);
		}
		if (settings.close) {
			$(".tipbox").hide();return;
		}
		if (!$('.tipbox')[0]) {
			$('body').append('<div class="tipbox"><div class="tip-l"></div><div class="tip-c"></div><div class="tip-r"></div></div>');
			$('.tipbox').css('z-index', parseInt(settings.zindex));
		}
		$('.tipbox').attr('class', 'tipbox tip-' + settings.icon);
		$('.tipbox .tip-c').html(settings.content);
		$('.tipbox').css('z-index', parseInt($('.tipbox').css('z-index')) + 1).setmiddle().show();

		if (settings.time > 0) {
			setTimeout(function() {
				$(".tipbox").fadeOut();
			}, settings.time);
		}
	};
})(jQuery);

/**
 * 无限级联异步加载下拉框插件
 * author：vakinge
 * */
;(function($) {
	// 异步加载下拉框
	$.fn.asnycSelect = function(options) {
		return this.each(function(){
			  new asnycSelect().builder($(this),options);
		});
	};
	
	$.fn.setAsnycSelectVal = function(vals) {
		if(!vals)return;
		vals = vals.split('-');
		var $select,i = 0,interval = null;
		$select = this.eq(0);
	    interval=setInterval(function(){
	       if($select.children().length > 1){
	    	   if(!vals[i] || vals[i]==''){clearInterval(interval);return;}
	    	   $select.find("option[value='"+vals[i]+"']").attr("selected",true).change();
	         i++;
	         $select = $select.next();
	         if(i == vals.length){
	            clearInterval(interval);
	         }
	       }
	    }, 500);
	};
	function asnycSelect(){
		this.settings = {
			linkage:false,//是否联动菜单
			actionUrl:null,//请求地址
			valtarget:null,//值输出元素（选择的值最终保存在）
			pid:0,//
			level: 1,
			maxlevel:1,//最大级 默认：1
			resultWithParent:false //输出值是否包含父级值（如:100-1001）
		};
		this.builder = function($target,options){
	    	options = $.extend(this.settings,options);
			var $subSelect,settings = this.settings;
			$target.attr("level",settings.level).empty();
			$.ajax({
				  type: "GET",
				  url: settings.actionUrl.replace(/_PID_/, settings.pid),
				  cache: true,
				  dataType: "json",
				  success: function(result){
				   if(!result)return;
				   $target.append("<option value=''>请选择</option>");
				   for(var i in result){
					   $target.append("<option value='"+i+"'>"+result[i]+"</option>");
				   }
				   var linkages = $target.parent().find('select').length;
				   var linkNext = settings.linkage && settings.maxlevel > linkages &&settings.maxlevel > settings.level;
				   if(linkNext){
					   $subSelect = $target.clone();
					   $subSelect.empty().append("<option value=''>请选择</option>");
					   $subSelect.insertAfter($target);
				   
				   }
				   $target.on('change',function(){
					   var $this = $(this),
					       selectVal = '',selectText = '';//
					   if($this.val() == '')return;
					   //多级下拉框值用“-”连接,如：123-234
					   if(settings.resultWithParent){
						   $this.parent().find('select').each(function(index){
							   var val = $(this).val();
							   if(val !=null && val != '' && val != 'null'){
								   selectVal = selectVal + (index == 0 ? "" : "-") + val;
								   selectText =selectText + (index == 0 ? "" : "-") + $(this).find("option:selected").text();
							   }
							   //仅读取当前下拉框的值
							   if($this.attr("level") == $(this).attr("level")){return false;}
							   
						   });
					   }else{
						   selectVal=$this.val();
						   selectText=$this.find("option:selected").text();
					   }
					   
					   $(settings.valtarget).val(selectVal).attr("text",selectText);
					   if(!linkNext)return;
					   options.level = parseInt($this.attr("level")) + 1;
					   options.pid = $this.val();
					   $subSelect.asnycSelect(options);
				   });
				}
				});
	  };
	};		  
})(jQuery);

/*!
 * 初始化上传组件
 */
;(function($) {
	$.fn.ajaxUploader = function(options) {
		var settings = {
	            form_selecter: 'form',
	            action_url: '',
	            input_name: 'file',
	            allowExts: '.txt,.xml,.properties',
	            onSubmit: function(id, fileName){},
	            onFinish: function(fileName){}
	    };
	    if(options) {$.extend(settings, options);}
	        
		var $target = $(this);
		$target.on('change',function(){
			var fileName = $target.val();
			var fileType = (fileName.substring(fileName.lastIndexOf(".")+1,fileName.length)).toLowerCase();
			if(".txt,.xml,.properties".indexOf(fileType) < 0){
				$.error('文件类型不支持');return;
			}
			var $form = $(settings.form_selecter);
			$form.find('[name]').attr('disabled',true);
			$form.attr('enctype','multipart/form-data');
			$target.attr('name',settings.input_name);
			$form.ajaxSubmit({
				  dataType:"JSON",
				  url:settings.action_url,
				  success:function(data) {
				     $form.find('[name]').removeAttr("disabled"); 
			         $target.removeAttr('name');
			         $form.removeAttr('enctype');
					 if(data.status == 1){
						$target.attr('disabled',true);
						$target.removeAttr('name');
						$form.removeAttr('enctype');
						$.success('上传成功');
						settings.onFinish(data.fileName,data.content);
					 }else{
						$.error( data.msg);	
					 }
				  },
				  error: function (data, status, e){
					  $target.attr('disabled',true);
					  $form.find('[name]').removeAttr("disabled"); 
				      $target.removeAttr('name');
				      $form.removeAttr('enctype');
					  $.error(e);
				  }
			});
		});
		return this;
	};
})(jQuery);

